int aimkey;
bool GetAimKey()
{
	if (!usecontroller)
	{


		if (!Settings.CloseEnnemy)
		{
			return (MouseController::GetAsyncKeyState(hotkeys::aimkey));
		}
		else
		{
			if (Settings.UseCustomCrKey)
			{
				if (Settings.CloseRange)
				{

					return (MouseController::GetAsyncKeyState(hotkeys::aimkeyCR));
				}
			}
			else
			{
				return (MouseController::GetAsyncKeyState(hotkeys::aimkey));
			}
		}
	}
	else
	{
		if (useps4controller)
		{
			sf::Joystick::update();

			if (sf::Joystick::isConnected(0))
			{
				if (UseLeftTrigger)
				{
					return sf::Joystick::isButtonPressed(0, 6);
				}
				else if (UseRightTrigger)
				{

					return sf::Joystick::isButtonPressed(0, 7);
				}
			}
			
		
		}
		else if (usexboxcontroller)
		{
			if (Controller::Player1->CheckConnection())
			{
				if (UseLeftTrigger)
				{
					return Controller::IsPressingLeftTrigger();

				}
				else if (UseRightTrigger)
				{
					return Controller::IsPressingRightTrigger();
				}

			}
		}

	}
	

}



