std::wstring MBytesToWString(const char* lpcszString)
{
	int len = strlen(lpcszString);
	int unicodeLen = ::MultiByteToWideChar(CP_ACP, 0, lpcszString, -1, NULL, 0);
	wchar_t* pUnicode = new wchar_t[unicodeLen + 1];
	memset(pUnicode, 0, (unicodeLen + 1) * sizeof(wchar_t));
	::MultiByteToWideChar(CP_ACP, 0, lpcszString, -1, (LPWSTR)pUnicode, unicodeLen);
	std::wstring wString = (wchar_t*)pUnicode;
	delete[] pUnicode;
	return wString;
}
std::string WStringToUTF8(const wchar_t* lpwcszWString)
{
	char* pElementText;
	int iTextLen = ::WideCharToMultiByte(CP_UTF8, 0, (LPWSTR)lpwcszWString, -1, NULL, 0, NULL, NULL);
	pElementText = new char[iTextLen + 1];
	memset((void*)pElementText, 0, (iTextLen + 1) * sizeof(char));
	::WideCharToMultiByte(CP_UTF8, 0, (LPWSTR)lpwcszWString, -1, pElementText, iTextLen, NULL, NULL);
	std::string strReturn(pElementText);
	delete[] pElementText;
	return strReturn;
}
void DrawString(float fontSize, int x, int y, RGBA* color, bool bCenter, bool stroke, const char* pText, ...)
{
	va_list va_alist;
	char buf[1024] = { 0 };
	va_start(va_alist, pText);
	_vsnprintf_s(buf, sizeof(buf), pText, va_alist);
	va_end(va_alist);
	std::string text = WStringToUTF8(MBytesToWString(buf).c_str());
	if (bCenter)
	{
		ImVec2 textSize = ImGui::CalcTextSize(text.c_str());
		x = x - textSize.x / 2;
		y = y - textSize.y;
	}
	if (stroke)
	{
		ImGui::GetOverlayDrawList()->AddText(ImGui::GetFont(), fontSize, ImVec2(x + 1, y + 1), ImGui::ColorConvertFloat4ToU32(ImVec4(0, 0, 0, 1)), text.c_str());
		ImGui::GetOverlayDrawList()->AddText(ImGui::GetFont(), fontSize, ImVec2(x - 1, y - 1), ImGui::ColorConvertFloat4ToU32(ImVec4(0, 0, 0, 1)), text.c_str());
		ImGui::GetOverlayDrawList()->AddText(ImGui::GetFont(), fontSize, ImVec2(x + 1, y - 1), ImGui::ColorConvertFloat4ToU32(ImVec4(0, 0, 0, 1)), text.c_str());
		ImGui::GetOverlayDrawList()->AddText(ImGui::GetFont(), fontSize, ImVec2(x - 1, y + 1), ImGui::ColorConvertFloat4ToU32(ImVec4(0, 0, 0, 1)), text.c_str());
	}
	ImGui::GetOverlayDrawList()->AddText(ImGui::GetFont(), fontSize, ImVec2(x, y), ImGui::ColorConvertFloat4ToU32(ImVec4(color->R / 255.0, color->G / 255.0, color->B / 255.0, color->A / 255.0)), text.c_str());
}

void AimAt(DWORD_PTR entity, Vector3 Localcam,bool close)
{
	uint64_t currentactormesh = Drv->Rpm<uint64_t>(entity + 0x300);// = Drv->Rpm<uint64_t>(processID, entity + 0x280); // changes often 4u
	Vector3 rootHead;


	

	if (Settings.RandoAim)
	{

		srand((unsigned)time(NULL));

		int ran = (rand() % 9);

		switch (ran)
		{

		case 1:
			//Aimbone head
			Settings.AimBoneInt == 68;
			Settings.AimBoneInt = 68;
			break;
		case 2:
			//aimbone neck
			Settings.AimBoneInt == 67;
			Settings.AimBoneInt = 67;
			break;
		case 3:
			//aimbone chest
			Settings.AimBoneInt == 5;
			Settings.AimBoneInt = 5;
			break;
		case 4:
			//aimbone right hand
			Settings.AimBoneInt == 35;
			Settings.AimBoneInt = 35;
			break;
		}

	}
	if (!Settings.RandoAim)
	{
		if (Settings.hitboxpos == 0)//head
		{
			Settings.AimBoneInt = 68;

		}
		else if (Settings.hitboxpos == 1)//NECK
		{
			Settings.AimBoneInt = 67;

		}
		else if (Settings.hitboxpos == 2)//CHEST
		{
			Settings.AimBoneInt = 5;

		}
		else if (Settings.hitboxpos == 3)//PELVIS
		{
			Settings.AimBoneInt = 2;

		}
	}
		

		rootHead = GetBoneWithRotation(currentactormesh, Settings.AimBoneInt);

	Vector3 rootHeadOut = ProjectWorldToScreen(rootHead, Vector3(Localcam.y, Localcam.x, Localcam.z));
	

	if (rootHeadOut.x != 0 || rootHeadOut.y != 0)  // these are both y in all updates, fixed 4u, is old bug never fixed
	{
		if ((GetCrossDistance(rootHeadOut.x, rootHeadOut.y, Width  / 2, Height  / 2) <= Settings.AimFOV * 8) || Settings.isaimbotting)
		{
			if (Settings.AimingLine)
			{

				if (!Settings.ColorPreset)
				{
					auto AimingLineCOlor = ImGui::GetColorU32({ Settings.AimingLineColor[0], Settings.AimingLineColor[1], Settings.AimingLineColor[2], Settings.AimingLineColor[3] });
					ImGui::GetOverlayDrawList()->AddLine(ImVec2(ScreenCenterX, Height  / 2), ImVec2(rootHeadOut.x, rootHeadOut.y), AimingLineCOlor, 1);
				}
				else if (Settings.ColorPreset)
				{

					ImGui::GetOverlayDrawList()->AddLine(ImVec2(ScreenCenterX, Height  / 2), ImVec2(rootHeadOut.x, rootHeadOut.y), ImGui::ColorConvertFloat4ToU32(ImVec4(255 / 255.0, 0 / 255.0, 0 / 255.0, 255 / 255.0)), 1);
				}

			}
			if (Settings.Aimbot)
			{
				if (GetAimKey())
				{
					if (Settings.CloseRange && close)
					{
						aimbotCL(rootHeadOut.x, rootHeadOut.y);
					}
					else
					{
						aimbot(rootHeadOut.x, rootHeadOut.y);
					}
				}

			}
		}
	}
}

